import React, { Component } from 'react';
import './TopMenu';
import PropTypes from 'prop-types';

class TopMenu extends Component {
    static propTypes = {

    };

    render() {
        const { topMenu = [] } = this.props;

        return (
            <div className="header__menu-wrapper">
                <ul className="haeder__menu">
                    {topMenu.map((element, index) => {
                        const { title, link } = element;
                        return (
                            <li className="header__menu-element" key={index + element}>
                                <a href={link} className="header__menu-link">
                                    {title}
                                </a> 
                            </li>
                        );
                    })}
                </ul>
            </div>
        );
    }
};

export default TopMenu;
